import React from 'react';
import PropTypes from 'prop-types';

import './Button.scss'

const Button = ({ type = 'button', onClick, children }) => (
    <button 
        className='Button'
        type={type}
        onClick={onClick}
    >
        {children}
    </button>
);

Button.propTypes = {
    type: PropTypes.string,
    clicked: PropTypes.func
};

export default Button;
